- input: 'TEXT,F3XA,,"Dear FEC:  This amendment was done as request by RQ-2 dated
    January 27, 2006.  This amendment has been filed after a phone consultation with
    Laura Sinram our Reports Analysis.  We have clariefied by phone and in this filing
    that ''premiums'' are books for our membership. (Donor Premiums)  We will no longer
    use that term in FEC filings.  We have also provided a breakdown of our gross
    payroll by each employe as requested.  ADP requires two transactions every payroll.
    1. Emoloye Net Checks. 2. Lump sum of taxes paid out to Government tax agencies.  If
    their is further informaiton needed please let us know.  Thank you.  Michael Bowman"'
  record: fec.version.v5_3.TEXT
